import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import OurTeam from '../components/OurTeam';

const AboutTeamPage = () => {
  return (
    <div>
      <Navbar />
      <OurTeam />
      <Footer />
    </div>
  );
};

export default AboutTeamPage;
